import React from 'react';
import Produto from './Produto';

const App = () => {
  const [ativar, setAtivar] = React.useState(false);
  return (
    <div>
      <button
        onClick={() => {
          setAtivar(!ativar);
        }}
      >
        Ativar
      </button>
      <Produto />
    </div>
  );
};

export default App;
